  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of the project is
  to continue ongoing partnership between the U.S. Fish and Wildlife Service and Friends
  of Nevada Wilderness for monitoring and repair of fences along the exterior boundary
  of Sheldon National Wildlife Refuge (NWR) to prevent invasion and re-population
  of non-native horses and burros from surrounding public and private lands and for
  continued removal of abandoned livestock developments (i.e. internal fencing and
  spring developments) and rehabilitation to restore important riparian habitats damaged
  by feral horses and burros in the past.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
